import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SpeedSlalomBasic } from '../Model/Interface';

const host = 'localhost:3001';


const AnalyzeSSR = () => {
  const [AthletesSSRecordsData, setAthletesSSRecordsData] = useState<SpeedSlalomBasic[]>([]);

  useEffect(() => {
    axios.get(`http://${host}/api/getSSRcords`)
      .then(response => {
        setAthletesSSRecordsData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Athlete Name</th>
            <th>Min</th>
            <th>Max</th>
            <th>Average</th>
          </tr>
        </thead>
        <tbody>
          {Object.keys(AthletesSSRecordsData).map(athleteName => (
             <td key={athleteName}>{athleteName}</td>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AnalyzeSSR;
